import React, { useContext } from "react";
import { DarkModeContext } from "./DarkModeContext";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import AnimatedBackground from "./AnimatedBackground";
import TypingEffect from "react-typing-effect";
import { FaGithub, FaLinkedin, FaTwitter } from "react-icons/fa";

const Hero = () => {
  const { isDarkMode } = useContext(DarkModeContext);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <section
      id="home"
      className={`min-h-screen flex items-center relative overflow-hidden ${
        isDarkMode
          ? "bg-gradient-to-br from-[#0a0a1a] via-[#1a1a2e] to-[#0a0a1a]"
          : "bg-gradient-to-r from-blue-50 to-purple-50"
      }`}
    >
      {/* Animated Background */}
      <div className="absolute inset-0 z-0">
        <AnimatedBackground />
      </div>

      <div className="container mx-auto px-4 relative z-10">
        {/* First Row: Left (Text) - Right (Image) */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-8 items-center">
          {/* Left Column (Text) */}
          <div className="space-y-6">
            <div className="space-y-2">
              <h2 className={`text-lg ${isDarkMode ? "text-purple-400" : "text-blue-600"} code-text`}>
                &lt;Hello World /&gt;
              </h2>
              <h1
                className="text-5xl font-bold code-text"
                data-aos="zoom-in"
                data-aos-easing="ease-out-cubic"
                data-aos-duration="1000"
                data-aos-delay="200"
              >
                <TypingEffect
                  text={["Hi, I'm Rohann Keerthy"]}
                  speed={100}
                  eraseDelay={500}
                  typingDelay={500}
                  cursorColor={isDarkMode ? "#4a1d96" : "#000000"}
                />
              </h1>
            </div>

            <p className={`text-lg ${isDarkMode ? "text-gray-300" : "text-gray-700"}`} data-aos="fade-right" data-aos-delay="400">
              Driven Computer Science and Engineering student specializing in Artificial Intelligence and Machine Learning, dedicated to designing innovative, scalable solutions that enhance user experiences and optimize system performance.
            </p>

            <div className="flex space-x-4" data-aos="fade-up" data-aos-delay="600">
              <a
                href="https://github.com/Rohann-79"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-2 rounded-lg ${
                  isDarkMode
                    ? "bg-[#2a2a3e] hover:bg-[#3a3a4e] text-purple-400"
                    : "bg-white hover:bg-gray-100 text-gray-800"
                } transition-all duration-300 hover:scale-110`}
              >
                <FaGithub className="text-2xl" />
              </a>
              <a
                href="https://www.linkedin.com/in/rohann-keerthy-9a9906219/"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-2 rounded-lg ${
                  isDarkMode
                    ? "bg-[#2a2a3e] hover:bg-[#3a3a4e] text-purple-400"
                    : "bg-white hover:bg-gray-100 text-gray-800"
                } transition-all duration-300 hover:scale-110`}
              >
                <FaLinkedin className="text-2xl" />
              </a>
              <a
                href="https://x.com/Rohann80172064"
                target="_blank"
                rel="noopener noreferrer"
                className={`p-2 rounded-lg ${
                  isDarkMode
                    ? "bg-[#2a2a3e] hover:bg-[#3a3a4e] text-purple-400"
                    : "bg-white hover:bg-gray-100 text-gray-800"
                } transition-all duration-300 hover:scale-110`}
              >
                <FaTwitter className="text-2xl" />
              </a>
            </div>

            <div className={`mt-8 p-4 rounded-lg ${
              isDarkMode ? "bg-[#2a2a3e]" : "bg-white/50"
            } backdrop-blur-sm`} data-aos="fade-up" data-aos-delay="800">
              <p className="text-sm font-mono">
                <span className="text-purple-400">const</span>{" "}
                <span className="text-purple-400">skills</span> = [
                <span className="text-purple-400">"AI/ML"</span>,
                <span className="text-purple-400">"Full Stack"</span>,
                <span className="text-purple-400">"Cloud"</span>
                ];
              </p>
            </div>
          </div>

          {/* Right Column (Animated Illustration) */}
          <div className="flex justify-center" data-aos="fade-left" data-aos-delay="800">
            <img
              src="/images/home-main.svg"
              alt="Hero Illustration"
              className={`w-full max-w-md ${
                isDarkMode ? "filter brightness-90" : ""
              }`}
            />
          </div>
        </div>

        {/* Second Row: Left (Carousel) - Right (Text) */}
        <div className="grid grid-cols-1 md:grid-cols-2 gap-8 items-center mt-16">
          {/* Left Column (Carousel) */}
          <div className="flex justify-center" data-aos="fade-right" data-aos-delay="1000">
            <Slider {...settings} className="w-full max-w-md">
              <div>
                <img
                  src="/images/project1.png"
                  alt="Project Screenshot 1"
                  className="rounded-lg shadow-lg"
                />
              </div>
              <div>
                <img
                  src="/images/project2.png"
                  alt="Project Screenshot 2"
                  className="rounded-lg shadow-lg"
                />
              </div>
              <div>
                <img
                  src="/images/project3.png"
                  alt="Project Screenshot 3"
                  className="rounded-lg shadow-lg"
                />
              </div>
            </Slider>
          </div>

          {/* Right Column (Text) */}
          <div className="space-y-6" data-aos="fade-left" data-aos-delay="1200">
            <p className={`text-base ${isDarkMode ? "text-gray-300" : "text-gray-700"}`}>
              Developed impactful projects, including a caffeine-tracking platform with React, a real-time age and gender detection system using OpenCV, and a Discord music bot deployed on Raspberry Pi. Proficient in Python, Java, React.js, and cloud technologies like AWS, combining technical expertise with strong problem-solving and teamwork skills.
            </p>
            <p className={`text-base ${isDarkMode ? "text-gray-300" : "text-gray-700"}`}>
              A LeetCode enthusiast with over 200 DSA problems solved, a state-level Abacus medalist, and a competitive E-Sports player, bringing a blend of analytical rigor and creative innovation to every challenge.
            </p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
